import { createGlobalStyle } from "styled-components";
import { reset, Reset } from 'styled-reset';


// 모든 컴포넌트에 적용 createGlobalStyle``;
const GlobalStyle = createGlobalStyle`
${ reset };

  body {
    font-family: '돋움', sans-serif;
  }
  body * {
    box-sizing: border-box;
  }
`;

function App() {
  return (
      <>
        <GlobalStyle />
      </>
  );
}

export default App;
